import { useState } from "react"
import { Diagnosis, HealthCheckRating, Patient } from "../../types"
import patientService from "../../services/patients"


const EntryAddForm = ({id}: {id: string | null}) => {

    const [description, setDescription] = useState<string>('')
    const [date, setDate] = useState<string>('')
    const [specialist, setSpecialist] = useState<string>("")
    const [healthCheckRating, setHealthCheckRating] = useState<HealthCheckRating | null>(null)
    const [diagnosiscodes, setDiagnosiscodes] = useState<Array<Diagnosis['code']> | []>([])

    const onSubmitHandler = (event: { preventDefault: () => void }) => {
        event.preventDefault()
        patientService.postEntry({
            description: description,
            date: date,
            specialist: specialist,
            healthCheckRating: healthCheckRating,
            diagnosiscodes: diagnosiscodes
        })
    }


    return (
<div>
    <h3>New HealthCheck Entry</h3>
    <form onSubmit={onSubmitHandler} >
        Description: <input
        type="text"
        value={description}
        onChange={((event) => setDescription(event.target.value))}
        />
        <br />
        Date: <input
        type="date"
        value={date}
        onChange={((event) => setDate(event.target.value))}
        />
         <br />
        Specialist: <input
        type="text"
        value={specialist}
        onChange={((event) => setSpecialist(event.target.value))}
        />
        <br />
        Health Check Rating: <input
        type="number"
        value={healthCheckRating || ''}
        onChange={((event) => setHealthCheckRating(Number(event.target.value)))}
        />
        <br />
        Diagnosis codes: <input
        type="text"
        value={diagnosiscodes || []}
        onChange={((event) => setDiagnosiscodes(codes => [...codes, event.target.value]))}
        />
<button type="submit">add entry</button>
    </form>
</div>
    )
}


export default EntryAddForm
